import React, { useState } from 'react';
import { 
  Box, 
  Typography, 
  Paper, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow,
  Chip,
  Button,
  Stack,
  IconButton,
  Tooltip
} from '@mui/material';
import { motion, AnimatePresence } from 'framer-motion';
import { 
  Check, 
  X, 
  Star, 
  TrendingUp, 
  Shield, 
  Zap, 
  Crown,
  Info,
  Compare
} from 'lucide-react';

const TierComparison = ({ tiers, theme }) => {
  const [selectedTiers, setSelectedTiers] = useState([]);

  const getTierIcon = (tierName) => {
    const name = tierName.toLowerCase();
    if (name.includes('core')) return <Shield size={20} />;
    if (name.includes('plus')) return <Zap size={20} />;
    if (name.includes('max')) return <Crown size={20} />;
    return <Star size={20} />;
  };

  const getTierColor = (tierName) => {
    const name = tierName.toLowerCase();
    if (name.includes('core')) return 'primary';
    if (name.includes('plus')) return 'secondary';
    if (name.includes('max')) return 'error';
    return 'default';
  };

  const toggleTierSelection = (tier) => {
    setSelectedTiers(prev => {
      const isSelected = prev.find(t => t.id === tier.id);
      if (isSelected) {
        return prev.filter(t => t.id !== tier.id);
      } else {
        return [...prev, tier];
      }
    });
  };

  const allFeatures = tiers.reduce((acc, tier) => {
    tier.features.forEach(feature => {
      if (!acc.includes(feature)) {
        acc.push(feature);
      }
    });
    return acc;
  }, []);

  const containerVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: {
        duration: 0.6,
        staggerChildren: 0.1
      }
    }
  };

  const rowVariants = {
    hidden: { opacity: 0, x: -20 },
    visible: { 
      opacity: 1, 
      x: 0,
      transition: {
        duration: 0.4
      }
    }
  };

  return (
    <motion.div
      variants={containerVariants}
      initial="hidden"
      animate="visible"
    >
      <Paper 
        elevation={3}
        sx={{ 
          p: 4, 
          borderRadius: 4,
          background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
          mb: 4
        }}
      >
        <Box sx={{ textAlign: 'center', mb: 4 }}>
          <Typography variant="h4" fontWeight="bold" color="text.primary" sx={{ mb: 2 }}>
            <Compare size={32} style={{ marginRight: 12, verticalAlign: 'middle' }} />
            Plan Comparison
          </Typography>
          <Typography variant="body1" color="text.secondary" sx={{ mb: 3 }}>
            Compare features across different tiers to find the perfect plan for your needs
          </Typography>

          {/* Tier Selection */}
          <Stack direction="row" spacing={2} justifyContent="center" flexWrap="wrap">
            {tiers.map((tier) => {
              const isSelected = selectedTiers.find(t => t.id === tier.id);
              return (
                <motion.div
                  key={tier.id}
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                >
                  <Chip
                    label={tier.name}
                    color={getTierColor(tier.name)}
                    icon={getTierIcon(tier.name)}
                    onClick={() => toggleTierSelection(tier)}
                    sx={{
                      cursor: 'pointer',
                      fontWeight: 'bold',
                      opacity: isSelected ? 1 : 0.6,
                      transform: isSelected ? 'scale(1.1)' : 'scale(1)',
                      transition: 'all 0.2s'
                    }}
                  />
                </motion.div>
              );
            })}
          </Stack>
        </Box>

        {/* Comparison Table */}
        {selectedTiers.length > 0 && (
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.3 }}
          >
            <TableContainer component={Paper} elevation={2} sx={{ borderRadius: 3 }}>
              <Table>
                <TableHead>
                  <TableRow sx={{ bgcolor: 'primary.main' }}>
                    <TableCell sx={{ color: 'white', fontWeight: 'bold' }}>
                      Features
                    </TableCell>
                    {selectedTiers.map((tier) => (
                      <TableCell 
                        key={tier.id} 
                        align="center"
                        sx={{ color: 'white', fontWeight: 'bold' }}
                      >
                        <Stack alignItems="center" spacing={1}>
                          {getTierIcon(tier.name)}
                          <Typography variant="subtitle1">
                            {tier.name}
                          </Typography>
                          <Typography variant="h6" fontWeight="bold">
                            {tier.price}
                          </Typography>
                        </Stack>
                      </TableCell>
                    ))}
                  </TableRow>
                </TableHead>
                <TableBody>
                  {allFeatures.map((feature, index) => (
                    <motion.tr
                      key={index}
                      variants={rowVariants}
                      component={TableRow}
                      sx={{
                        '&:nth-of-type(odd)': {
                          bgcolor: 'action.hover'
                        }
                      }}
                    >
                      <TableCell sx={{ fontWeight: 'medium' }}>
                        {feature}
                      </TableCell>
                      {selectedTiers.map((tier) => {
                        const hasFeature = tier.features.includes(feature);
                        return (
                          <TableCell key={tier.id} align="center">
                            <motion.div
                              initial={{ scale: 0 }}
                              animate={{ scale: 1 }}
                              transition={{ delay: index * 0.1 }}
                            >
                              {hasFeature ? (
                                <Check 
                                  size={20} 
                                  color={theme.palette.success.main}
                                />
                              ) : (
                                <X 
                                  size={20} 
                                  color={theme.palette.error.main}
                                />
                              )}
                            </motion.div>
                          </TableCell>
                        );
                      })}
                    </motion.tr>
                  ))}

                  {/* Benefits Row */}
                  <TableRow sx={{ bgcolor: 'success.light' }}>
                    <TableCell sx={{ fontWeight: 'bold', color: 'success.contrastText' }}>
                      <Stack direction="row" alignItems="center" spacing={1}>
                        <TrendingUp size={20} />
                        Key Benefits
                      </Stack>
                    </TableCell>
                    {selectedTiers.map((tier) => (
                      <TableCell key={tier.id} align="center">
                        <Stack spacing={1}>
                          {tier.benefits?.map((benefit, index) => (
                            <motion.div
                              key={index}
                              initial={{ opacity: 0, x: -10 }}
                              animate={{ opacity: 1, x: 0 }}
                              transition={{ delay: index * 0.1 }}
                            >
                              <Chip
                                label={benefit}
                                size="small"
                                sx={{
                                  bgcolor: 'success.main',
                                  color: 'white',
                                  fontSize: '0.75rem'
                                }}
                              />
                            </motion.div>
                          ))}
                        </Stack>
                      </TableCell>
                    ))}
                  </TableRow>
                </TableBody>
              </Table>
            </TableContainer>
          </motion.div>
        )}

        {/* Empty State */}
        {selectedTiers.length === 0 && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.5 }}
          >
            <Box sx={{ 
              textAlign: 'center', 
              py: 6,
              color: 'text.secondary'
            }}>
              <Info size={48} style={{ marginBottom: 16, opacity: 0.5 }} />
              <Typography variant="h6" sx={{ mb: 2 }}>
                Select tiers to compare
              </Typography>
              <Typography variant="body2">
                Click on the tier chips above to start comparing features
              </Typography>
            </Box>
          </motion.div>
        )}
      </Paper>
    </motion.div>
  );
};

export default TierComparison;
